import React from 'react';
import logo from '../../img/puma-logo.svg';
import './App.css';
import Menu from './../Menu/Menu';

class App extends Component {
	render() {
		return (
			<div>
				<div>
					<div className="main">
						<header className="menu">
							<img src={logo} className="App-logo" alt="logo" />
							<Menu />
						</header>
					</div>
				</div>
			</div>
		);
	}
}

export default App;
